import './Navbar.css'
import React, { Component } from 'react';

export default function Navbar() {
    return (
        <nav className="navbar">
            <div className='head'>
                <h1>An<span>Qi.</span></h1>
            </div>
            
            <div className='links'>
                <a className='nav project' href='/project'>Project</a>
                <a className='nav' href='/about'>About</a>
                <a className='nav' href='/'>Resume</a>
            </div>
        </nav>
    );
}
